import { applyUpdate, Doc } from 'yjs';
import { DSLModel } from './model';

const state =
  '';

test('领域模型 DSL 转换集成测试', () => {
  const buff = Buffer.from(state, 'base64');
  const ydoc = new Doc();
  applyUpdate(ydoc, buff);

  const model = new DSLModel(ydoc);

  expect(model.toDSL()).toMatchSnapshot();
});
